es</ows:Keyword><ows:Keyword>sql_statement</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::4471</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>45.02484375 -12.99640625</ows:LowerCorner><ows:UpperCorner>45.296171875 -12.6384375</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:STATISTICALUNITS.IRIS=\"http://STATISTICALUNITS.IRIS\"><Name>STATISTICALUNITS.IRIS:contours_iris</Name><Title>CONTOURS IRIS</Title><Abstract>Contours géométriques des IRIS de l'INSEE</Abstract><ows:Keywords><ows:Keyword>Statistiques</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::4326</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-61.8098218 -21.38929713</ows:LowerCorner><ows:UpperCorner>55.83665387 51.08898944</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:LANDCOVER.CLC00_DOM=\"http://LANDCOVER.CLC00_DOM\"><Name>LANDCOVER.CLC00_DOM:clc00_dom</Name><Title>CORINE Land Cover - DOM - 2000</Title><Abstract>Inventaire biophysique de l'occupation des sols en 2000 en 50 postes. CORINE Land Cover est une base de données d’occupation des sols produite dans le cadre du programme européen d’observation de la Terre Copernicus. Cet inventaire biophysique de l’occupation des terres fournit une information géographique de référence pour 39 États européens. La continuité du programme et la diffusion des données CORINE Land Cover sont pilotées par l'Agence européenne pour l'environnement. Le producteur pour la France est le Service de la donnée et des études statistiques du ministère chargé de l’écologie. L'utilisation de cette base de données permet des applications variées adaptées aux problématiques de l'environnement et à celles de l'aménagement du territoire : production cartographique, exploitation à des fins statistiques ou bien encore analyses géographiques en combinaison avec d'autres bases de données. Outil de connaissance et d'analyse, CORINE Land Cover apporte également une aide à la décision comme instrument de suivi, de surveillance et de gestion de l'environnement, des milieux naturels et de l'aménagement de l'espace. La base de données CORINE Land Cover DOM 2000 a été réalisée à partir de CORINE Land Cover DOM 2006 et de la base des changements 2000-2006.</Abstract><ows:Keywords><ows:Keyword>Occupation du sol</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::4326</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-61.90315964 -21.48017901</ows:LowerCorner><ows:UpperCorner>55.93309174 16.60478396</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:LANDCOVER.CLC06_DOM=\"http://LANDCOVER.CLC06_DOM\"><Name>LANDCOVER.CLC06_DOM:clc06_dom</Name><Title>CORINE Land Cover - DOM - 2006</Title><Abstract>Inventaire biophysique de l'occupation des sols en 2006 en 50 postes. CORINE Land Cover est une base de données d’occupation des sols produite dans le cadre du programme européen d’observation de la Terre Copernicus. Cet inventaire biophysique de l’occupation des terres fournit une information géographique de référence pour 39 États européens. La continuité du programme et la diffusion des données CORINE Land Cover sont pilotées par l'Agence européenne pour l'environnement. Le producteur pour la France est le Service de la donnée et des études statistiques du ministère chargé de l’écologie. L'utilisation de cette base de données permet des applications variées adaptées aux problématiques de l'environnement et à celles de l'aménagement du territoire : production cartographique, exploitation à des fins statistiques ou bien encore analyses géographiques en combinaison avec d'autres bases de données. Outil de connaissance et d'analyse, CORINE Land Cover apporte également une aide à la décision comme instrument de suivi, de surveillance et de gestion de l'environnement, des milieux naturels et de l'aménagement de l'espace. La base de données CORINE Land Cover DOM 2006 a été réalisée à partir d'images satellitaires prises entre 2005 et 2008 et de données d'a