s d’occupation des sols produite dans le cadre du programme européen d’observation de la Terre Copernicus. Cet inventaire biophysique de l’occupation des terres fournit une information géographique de référence pour 39 États européens. La continuité du programme et la diffusion des données CORINE Land Cover sont pilotées par l'Agence européenne pour l'environnement. Le producteur pour la France est le  Service de la donnée et des études statistiques du ministère chargé de l’écologie. L'utilisation de cette base de données permet des applications variées adaptées aux problématiques de l'environnement et à celles de l'aménagement du territoire : production cartographique, exploitation à des fins statistiques ou bien encore analyses géographiques en combinaison avec d'autres bases de données. Outil de connaissance et d'analyse, CORINE Land Cover apporte également une aide à la décision comme instrument de suivi, de surveillance et de gestion de l'environnement, des milieux naturels et de l'aménagement de l'espace. La base de données CORINE Land Cover DOM 2018 a été réalisée à partir de CORINE Land Cover DOM 2012 révisée et de la base des changements 2012-2018.</Abstract><ows:Keywords><ows:Keyword>Occupation du sol</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::3857</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-61.90315964 -21.48017901</ows:LowerCorner><ows:UpperCorner>55.93309174 16.60478396</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:LANDCOVER.CHA06_DOM=\"http://LANDCOVER.CHA06_DOM\"><Name>LANDCOVER.CHA06_DOM:cha06_dom</Name><Title>CORINE Land Cover - DOM - Changements 2000-2006</Title><Abstract>Inventaire biophysique du changement d'occupation des sols entre 2000 et 2006 suivant la nomenclature CORINE Land Cover en 50 postes. CORINE Land Cover est une base de données d’occupation des sols produite dans le cadre du programme européen d’observation de la Terre Copernicus. Cet inventaire biophysique de l’occupation des t