eatureType xmlns:LABELS.TOURISTIQUES=\"http://LABELS.TOURISTIQUES\"><Name>LABELS.TOURISTIQUES:communes_touristiques</Name><Title>Communes touristiques</Title><Abstract>Communes touristiques</Abstract><ows:Keywords><ows:Keyword>features</ows:Keyword><ows:Keyword>communes_touristiques</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::4326</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-151.875 -22.475</ows:LowerCorner><ows:UpperCorner>166.640625 51.27109375</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:IGNF_GEODESIE=\"http://IGNF_GEODESIE\"><Name>IGNF_GEODESIE:triplet</Name><Title>Composante du réseau de nivellement constituée de groupes d’au moins trois repères faisant l’objet d’un entretien régulier</Title><Abstract>TRIPLET</Abstract><ows:Keywords><ows:Keyword>Triplet</ows:Keyword><ows:Keyword>Nivellement</ows:Keyword><ows:Keyword>Géodésie</ows:Keyword><ows:Keyword>Repère</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::4326</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-175.0 -75.0</ows:LowerCorner><ows:UpperCorner>175.0 85.0</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:PROTECTEDAREAS.MNHN.CDL.PARCELS=\"http://PROTECTEDAREAS.MNHN.CDL.PARCELS\"><Name>PROTECTEDAREAS.MNHN.CDL.PARCELS:cdl</Name><Title>Conservatoire du littoral - sites sous responsabilité du conservatoire</Title><Abstract>Les sites du conservatoire du littoral ont pour vocation la sauvegarde des espaces côtiers et lacustres. Leur accès au public est encouragé mais reste défini dans des limites compatibles avec la vulnérabilité de chaque site. Pour plus d'information : &lt;a href&gt;https://inpn.mnhn.fr/docs/map_pdf/cdl_f.pdf&lt;/a&gt;</Abstract><ows:Keywords><ows:Keyword>Littoral</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::3857</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-63.14490145 -21.38398375</ows:LowerCorner><ows:UpperCorner>55.83443328 51.08708741</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:PROTECTEDAREAS.MNHN.CDL.PERIMETER=\"http://PROTECTEDAREAS.MNHN.CDL.PERIMETER\"><Name>PROTECTEDAREAS.MNHN.CDL.PERIMETER:perimetre_autorise</Name><Title>Conservatoire du littoral : périmètres autorisés</Title><Abstract>L’intervention foncière du Conservatoire du littoral est plus particulièrement justifiée dans au moins un de ces quatre critères : - Lorsque le terrain fait l’objet de pressions en faveur de l’urbanisation mettant en échec la réglementation existante ou de menaces d’artificialisation irréversible du milieu ; - Lorsque le terrain connaît un processus de dégradation qui appelle une gestion patrimoniale pour restaurer la biodiversité et les paysages ; - Lorsque le terrain est inaccessible et que son ouverture au public est souhaitable ; - Lorsque la maîtrise foncière permet d’assurer la pérennité d’activités économiques traditionnelles garantes d’un paysage caractéristique ou d’équilibres écologiques remarquables. Ces interventions du Conservatoire répondent à quatre préoccupations : - C’est sur la zone côtière immédiate que les pressions sont les plus fortes ; - Il faut veiller à une répartition équilibrée des acquisitions ; - Certains grands sites nationaux ont une importance particulière, en fonction de critères écologiques, esthétiques et paysagers ; - Ces interventions doivent être appréciées au regard des interactions entre les espaces concernés et leur environnement et donc en termes de fonctionnalité au sein d’une zone plus large et plus complexe sur le plan des écosystèmes.</Abstract><ows:Keywords><ows:Keyword>Environnement, zones naturelles, paysages, écosystèmes</ows:Keyword><ows:Keyword>Mer et littoral</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::3857</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-63.193359375 -21.431132812</ows:LowerCorner><ows:UpperCorner>55.8984375 51.16890625</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:test_nl_kikoulol_allauch=\"http://tes