la BD TOPO v3 : voir le descriptif de contenu de la BD TOPO v3 : https://bit.ly/3knUlkQ pages 169 et 170. Ces premières couches de haies départementales squelettisées ont été produites dans le cadre du programme CarHAB</Abstract><ows:Keywords><ows:Keyword>haie</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::4326</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-63.15333395 -21.38972034</ows:LowerCorner><ows:UpperCorner>55.83675903 51.18890976</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:ELEVATION.CONTOUR.LINE=\"http://ELEVATION.CONTOUR.LINE\"><Name>ELEVATION.CONTOUR.LINE:courbe</Name><Title>Courbes de niveau</Title><Abstract>Le produit « Courbes de niveau » est un modèle numérique de terrain sous forme de courbes de même altitude, appelées aussi « isoplèthes d’altitude », ou plus techniquement « isohypses ». Ces courbes permettent la description du relief français.</Abstract><ows:Keywords><ows:Keyword>courbes de niveau</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::4326</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-63.15340092 -21.3896732</ows:LowerCorner><ows:UpperCorner>55.83678733 51.12086835</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:HYDROGRAPHY.BCAE.LATEST=\"http://HYDROGRAPHY.BCAE.LATEST\"><Name>HYDROGRAPHY.BCAE.LATEST:bcae_cours_eau</Name><Title>Cours d'eau BCAE dernière édition</Title><Abstract>Le code rural et de la pêche maritime prévoit que les agriculteurs qui demandent des aides de la PAC implantent des bandes enherbées le long de certains cours d'eau au titre des bonnes conditions agricoles et environnementales. Cette carte est en vigueur du 1er janvier 2024 au 31 décembre 2024. Pour les départements non métropolitains, veuillez-vous référer aux arrêtés préfectoraux relatifs aux BCAE.</Abstract><ows:Keywords><ows:Keyword>BCAE</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::2154</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-5.51063483 41.35