 BD Parcellaire et Parcellaire Express</Abstract><ows:Keywords><ows:Keyword>Parcellaire Express</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::3857</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-5.14076796 -4.46233984</ows:LowerCorner><ows:UpperCorner>9.55990504 64.15154681</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:AOC-VITICOLES=\"http://AOC-VITICOLES\"><Name>AOC-VITICOLES:aire_parcellaire</Name><Title>Délimitation parcellaire AOC viticole</Title><Abstract>Selon les règlements européens n°110/2008 du 15 janvier 2008, n°1151/2012 du 21 novembre 2012 et n°1308/2013 de l’OCM , le cahier des charges des appellations définit l’aire géographique. Le terme de « délimitation parcellaire » désigne une aire qui repose sur les limites administratives du cadastre (les parcelles) et dont le maillage suffisamment fin permet de tenir compte de variations très localisées des éléments du milieu physique. Elle correspond à l'aire de production de la matière première. Elle est incluse dans l'aire géographique. Données produites par l'Institut National des Origines et la Qualité (INAO)</Abstract><DefaultCRS>urn:ogc:def:crs:EPSG::2154</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-2.111875 41.31265625</ows:LowerCorner><ows:UpperCorner>9.589375 49.608125</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:dt_nord_ouest=\"http://dt_nord_ouest\"><Name>dt_nord_ouest:DT-NO</Name><Title>Département Nord-Ouest</Title><Abstract>Département Nord-Ouest</Abstract><ows:Keywords><ows:Keyword>Tutoriel</ows:Keyword><ows:Keyword>Données mondiales</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::2154</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-175.0 -75.0</ows:LowerCorner><ows:UpperCorner>175.0 85.0</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:test_geothermie_gpkg_10-02-2025_wfs=\"http://test_geothermie_gpkg_10-02-2025_wfs\"><Name>test_geothermie_gpkg_10-02-2025_wfs:Energie_potentiel_de_geothermie_a_la_commune</Name><Title>Energie_Geothermie_commune</Title><Abstract>Données relatives aux besoins en énergie (chaud/froid) et aux potentiels de la géothermie pour couvrir ces besoins, à la commune, sur le périmètre de la Métropole du Grand Paris.\n\nDescription des champs :    \n\nEchaud: Besoins de chaud (chauffage et ECS) [GWh/an]\nEfroid: Besoins de froid [GWh/an]\nratioGTHcha: Taux de couverture des besoins en chaud (chauffage et ECS) [%]\nEchaudGTH: Potentiel géothermique en chaud (chauffage et ECS) [GWh/an]\nratioGTHfroi: Taux de couverture des besoins en froid [%]\nEGTHfroi: Potentiel géothermique en froid [GWh/an]\nratio_1: Part de la consommation de gaz (pour la production de chauffage et d'ECS) remplaçable par de la géothermie de surface, pour les parcelles situées à moins de 50 m d'un réseau de chaleur [%]\nratio_2: Part de la consommation de gaz (pour la production de chauffage et d'ECS) remplaçable par de la géothermie de surface, pour les parcelles situées entre 50 m et 250 m d'un réseau de chaleur [%]\nratio_3: Part de la consommation de gaz (pour la production de chauffage et d'ECS) remplaçable par de la géothermie de surface, pour les parcelles situées à plus de 250 m d'un réseau de chaleur [%]\nratio_4: Part de la consommation de gaz (pour la production de chauffage et d'ECS) qui ne peut pas être remplacée par de la géothermie de surface [%]</Abstract><ows:Keywords><ows:Keyword>Energie</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::2154</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>2.137734375 48.642353516</ows:LowerCorner><ows:UpperCorner>2.631875 49.018496094</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:test_nl_bdtopo_le_havre_metropole=\"http://test_nl_bdtopo_le_havre_metropole\"><Name>test_nl_bdtopo_le_havre_metropole:equipement_de_transport</Name><Title>Equipements de transport</Title><Abstract>Equipements de transport du Havre Seine Métropole (Seine-Martime) issus de la BD T