rce du RGE Alti</Title><Abstract>Informations sur la précision du RGEAlti.</Abstract><ows:Keywords><ows:Keyword>Altitude</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::4326</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-63.18904211 -21.42727734</ows:LowerCorner><ows:UpperCorner>55.84453236 51.12965159</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:MESURES_COMPENSATOIRES=\"http://MESURES_COMPENSATOIRES\"><Name>MESURES_COMPENSATOIRES:emprises_commune</Name><Title>Mesures compensatoires : emprises communes</Title><Abstract>Carte des mesures compensatoires des atteintes à la biodiversité. Une mesure compensatoire d’atteinte à la biodiversité n'intervient que sur l'impact résiduel d'un projet d'aménagement, lorsque toutes les mesures envisageables ont été mises en œuvre pour éviter puis réduire les impacts négatifs sur la biodiversité. Elle vise à offrir une contrepartie positive à un impact dommageable non réductible provoqué par un projet, de façon à maintenir la biodiversité dans un état équivalent ou meilleur à celui observé avant sa réalisation.</Abstract><ows:Keywords><ows:Keyword>Mesures compensatoires</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::4326</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-53.77737151 -21.37632972</ows:LowerCorner><ows:UpperCorner>55.70531774 51.04258551</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:MESURES_COMPENSATOIRES=\"http://MESURES_COMPENSATOIRES\"><Name>MESURES_COMPENSATOIRES:emprises_lineaires</Name><Title>Mesures compensatoires : emprises linéaires</Title><Abstract>Carte des mesures compensatoires des atteintes à la biodiversité. Une mesure compensatoire d’atteinte à la biodiversité n'intervient que sur l'impact résiduel d'un projet d'aménagement, lorsque toutes les mesures envisageables ont été mises en œuvre pour éviter puis réduire les impacts négatifs sur la biodiversité. Elle vise à offrir une contrepartie positive à un impact dommageable non réductible provoqué par un projet, de façon à maintenir la biodiversité dans un état équivalent ou meilleur à celui observé avant sa réalisation.</Abstract><ows:Keywords><ows:Keyword>Mesures compensatoires</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::4326</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-53.77737151 -21.37632972</ows:LowerCorner><ows:UpperCorner>55.70531774 51.04258551</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:MESURES_COMPENSATOIRES=\"http://MESURES_COMPENSATOIRES\"><Name>MESURES_COMPENSATOIRES:emprises_polygones</Name><Title>Mesures compensatoires : emprises polygones</Title><Abstract>Carte des mesures compensatoires des atteintes à la biodiversité. Une mesure compensatoire d’atteinte à la biodiversité n'intervient que sur l'impact résiduel d'un projet d'aménagement, lorsque toutes les mesures envisageables ont été mises en œuvre pour éviter puis réduire les impacts négatifs sur la biodiversité. Elle vise à offrir une contrepartie positive à un impact dommageable non réductible provoqué par un projet, de façon à maintenir la biodiversité dans un état équivalent ou meilleur à celui observé avant sa réalisation.</Abstract><ows:Keywords><ows:Keyword>Mesures compensatoires</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::4326</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-53.77737151 -21.37632972</ows:LowerCorner><ows:UpperCorner>55.70531774 51.04258551</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:MESURES_COMPENSATOIRES=\"http://MESURES_COMPENSATOIRES\"><Name>MESURES_COMPENSATOIRES:emprises_ponctuelles</Name><Title>Mesures compensatoires : emprises ponctuelles</Title><Abstract>Carte des mesures compensatoires des atteintes à la biodiversité. Une mesure compensatoire d’atteinte à la biodiversité n'intervient que sur l'impact résiduel d'un projet d'aménagement, lorsque toutes les mesures envisageables ont été mises en œuvre pour éviter puis réduire