"http://unesco_pelee_wfs\"><Name>unesco_pelee_wfs:unesco_bien</Name><Title>Unesco_Pelee</Title><Abstract>Périmètre du bien UNESCO Volcans et forêts de la Montagne Pelée</Abstract><ows:Keywords><ows:Keyword>features</ows:Keyword><ows:Keyword>unesco_coeur</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::5490</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-61.22953125 14.63484375</ows:LowerCorner><ows:UpperCorner>-61.043671875 14.870859375</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:VIGINOND-DIFFUSION=\"http://VIGINOND-DIFFUSION\"><Name>VIGINOND-DIFFUSION:stationhydro</Name><Title>VIGINOND STATIONS</Title><Abstract>Stations hydrométriques du réseau Vigicrues</Abstract><ows:Keywords><ows:Keyword>VIGInond</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::4326</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-175.0 -85.0</ows:LowerCorner><ows:UpperCorner>175.0 85.0</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:VIGINOND-DIFFUSION=\"http://VIGINOND-DIFFUSION\"><Name>VIGINOND-DIFFUSION:zich</Name><Title>VIGINOND ZICH</Title><Abstract>La zone isoclasse hauteur (ZICH) représente la hauteur de submersion de la zone d’inondation potentielle par rapport au terrain naturel. Elle est caractérisée par son extension spatiale (qui est la même que celle de la ZIP) et les bornes minimale et maximale de sa plage de hauteur fixe. Les zones isoclasse hauteur forment une partition de la zone d’inondation potentielle. Tout point de la zone d’inondation potentielle est recouvert par une et une seule zone isoclasse hauteur.</Abstract><ows:Keywords><ows:Keyword>VIGInond</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::4326</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-175.0 -85.0</ows:LowerCorner><ows:UpperCorner>175.0 85.0</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:VIGINOND-DIFFUSION=\"http://VIGINOND-DIFFUSION\"><Name>VIGINOND-DIFFUSION:zip</Name><Title>VIGINOND ZIP</Title><Abstract>La zone d’inondation potentielle représente l’emprise surfacique de l’inondation pour une hauteur d’eau à l’échelle limnimétrique d’une ou plusieurs stations hydrométriques la ou les plus représentatives.</Abstract><ows:Keywords><ows:Keyword>VIGInond</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::4326</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-175.0 -85.0</ows:LowerCorner><ows:UpperCorner>175.0 85.0</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:LABELS.TOURISTIQUES=\"http://LABELS.TOURISTIQUES\"><Name>LABELS.TOURISTIQUES:villages_etape</Name><Title>Villages étape</Title><Abstract>Villages étape</Abstract><ows:Keywords><ows:Keyword>features</ows:Keyword><ows:Keyword>villages_etape</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::4326</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-151.875 -22.475</ows:LowerCorner><ows:UpperCorner>166.640625 51.27109375</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:ObsForets.Ressources=\"http://ObsForets.Ressources\"><Name>ObsForets.Ressources:volume_moyen_ha_dep_2018_2022</Name><Title>Volume moyen par hectare - département</Title><Abstract>Volume moyen dans un hectare de forêt du département (Volume bois fort tige des arbres vivants). Millésime 2018-2022. Source: IGN-Inventaire forestier.</Abstract><ows:Keywords><ows:Keyword>IFN</ows:Keyword><ows:Keyword>WFS</ows:Keyword><ows:Keyword>Forêt</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::4326</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-5.0 41.0</ows:LowerCorner><ows:UpperCorner>9.5 51.0</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:ObsForets.Ressources=\"http://ObsForets.Ressources\"><Name>ObsForets.Ressources:volume_sur_pied_dep_2017_2021</Name><Title>Volume sur pied - département</Title><Abstract>Volume de bois vivant par département. Millésime 2017-2021. Source: IGN-Inventaire forestier.</Abstract><ows:Keywords><ows:Keyword>IFN</ows:Keyword><ows:Keyword>WFS</ows:Keyword><ows:Keyword>Forêt</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::4326</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-5.0 41.0</ows:LowerCorner><ows:UpperCorner>9.5 51.0</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:ObsForets.Ressources=\"http://ObsForets.Ressources\"><Name>ObsForets.Ressources:volume_sur_pied_region_2017_2021</Name><Title>Volume sur pied - région</Title><Abstract>Volume de bois vivant par région. Millésime 2017-2021. Source: IGN-Inventaire forestier.</Abstract><ows:Keywords><ows:Keyword>IFN</ows:Keyword><ows:Keyword>WFS</ows:Keyword><ows:Keyword>Forêt</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::4326</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-5.0 41.0</ows:LowerCorner><ows:UpperCorner>9.5 51.0</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:zaer=\"http://zaer\"><Name>zaer:zaer</Name><Title>ZAER</Title><Abstract>Zones d'accélération des énergies renouvelables arrêtées par les référents préfectoraux issues du portail EnR</Abstract><DefaultCRS>urn:ogc:def:crs:EPSG::4326</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-175.0 -85.0</ows:LowerCorner><ows:UpperCorner>175.0 85.0</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:DREAL.ZONAGE_PINEL=\"http://DREAL.ZONAGE_PINEL\"><Name>DREAL.ZONAGE_PINEL:carreaux</Name><Title>Zonage du dispositif Pinel en Bretagne 2020-2021</Title><Abstract>La réduction d'impôt « Pinel » (code général des impôts) s'applique à l’investissement locatif réalisé dans les zones où la tension entre l'offre et la demande de logements est la plus forte.  La loi n°2019-1479 du 28 décembre 2019 de finances pour 2020, prévoit à titre expérimental, un dispositif dérogatoire au droit commun pour la Bretagne. Ainsi, les communes ou parties de communes éligibles à la réduction d'impôt « Pinel » sont fixées par arrêté du préfet de région. Cet arrêté est pris après avis du président du conseil régional et du comité régional de l'habitat et de l'hébergement. Cet article prévoit également que le préfet de région fixe,  par arrêté, les plafonds de loyer  et de ressources du locataire pour chaque commune ou partie de commune éligible et par type de logement.  L’une des particularités de cette expérimentation réside dans l’éligibilité du dispositif qui peut être limitée à une partie seulement du  territoire communal. Lorsqu’une commune n’est éligible que pour une partie de son territoire, deux approches sont distinguées, à savoir à la maille de  l’IRIS (correspondant à un quartier) ou à la maille du carreau de 200 mètres sur 200 mètres.</Abstract><ows:Keywords><ows:Keyword>zonage</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::3857</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-180.0 -85.0</ows:LowerCorner><ows:UpperCorner>180.0 85.0</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:DREAL.ZONAGE_PINEL=\"http://DREAL.ZONAGE_PINEL\"><Name>DREAL.ZONAGE_PINEL:communes</Name><Title>Zonage du dispositif Pinel en Bretagne 2020-2021</Title><Abstract>La réduction d'impôt « Pinel » (code général des impôts) s'applique à l’investissement locatif réalisé dans les zones où la tension entre l'offre et la demande de logements est la plus forte.  La loi n°2019-1479 du 28 décembre 2019 de finances pour 2020, prévoit à titre expérimental, un dispositif dérogatoire au droit commun pour la Bretagne. Ainsi, les communes ou parties de communes éligibles à la réduction d'impôt « Pinel » sont fixées par arrêté du préfet de région. Cet arrêté est pris après avis du président du conseil régional et du comité régional de l'habitat et de l'hébergement. Cet article prévoit également que le préfet de région fixe,  par arrêté, les plafonds de loyer  et de ressources du locataire pour chaque commune ou partie de commune éligible et par type de logement.  L’une des particularités de cette expérimentation réside dans l’éligib