CARTO_V5:commune</Name><Title>commune</Title><Abstract>BD CARTO® V5</Abstract><ows:Keywords><ows:Keyword>BDCARTO</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::4326</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-63.15371169 -21.38982666</ows:LowerCorner><ows:UpperCorner>55.83677582 51.31504801</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:BDCARTO_V5=\"http://BDCARTO_V5\"><Name>BDCARTO_V5:commune_associee_ou_deleguee</Name><Title>commune_associee_ou_deleguee</Title><Abstract>BD CARTO® V5</Abstract><ows:Keywords><ows:Keyword>BDCARTO</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::4326</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-63.15371169 -21.38982666</ows:LowerCorner><ows:UpperCorner>55.83677582 51.31504801</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:essai_gpkg_raster_v2_gpkg_03-02-2025_wfs=\"http://essai_gpkg_raster_v2_gpkg_03-02-2025_wfs\"><Name>essai_gpkg_raster_v2_gpkg_03-02-2025_wfs:composantes_de_la_trame_verte_nsm</Name><Title>composantes_de_la_trame_verte_93050</Title><Abstract>Les composantes de la trame verte sont les noyaux de biodiversité (noyaux primaires - N1, noyaux secondaires - N2) et les zones relais (ZR).\n\nLes composantes de la trame verte sont les noyaux de biodiversité (noyaux primaires - N1, noyaux secondaires - N2) et les zones relais (ZR).\n\nCes composantes ont été déterminées par croisement de la couche des hauteurs de végétation et de la couche des espaces végétalisés de plus de 100m². \n\n4 types d'espaces végétalisés ont été identifiés en fonction de la proportion de chaque strate de végétation qu'ils contiennent: boisé (si la somme des surfaces des strates arborées et arbustives couvre plus de 60% de l'espace), ouvert (si la surface des espaces herbacés couvre plus de 60% de l'espace), semi-ouvert (si la surface des espaces buissonnants couvre plus de 60% de l'espace), composite dans les autres cas.\n\nLa taille de chaque espace et/ou son appartenance à un site d'intérêt écologique reconnu (site Natura 2000, ZNIEFF de type 1, ENS etc.) a permis d'identifier 3 classes d'espaces : \n\n - les noyaux primaires  : espaces végétalisés inclus dans les sites d'intérêt écologique reconnus et/ou espaces de 5ha ou plus\n\n- les noyaux secondaires :  espaces végétalisés de 1 à 5ha \n\n- les zones relais : tous les autres espaces végétalisés de 1000m²  à 1ha\n\nL'indice de compacité permet de modéliser la forme de chaque espace végétalisé. L'indice de compacité et la superficie des espaces permet ensuite de calculer leur distance d'attraction, soit la distance maximale que les espèces peuvent parcourir depuis un site source vers un autre site, sans tenir compte de la rugosité de la matrice urbaine. La distance d'attraction permet de définir une zone tampon de déplacement théorique des espèces autour des espaces végétalisés,  également appelée aire de dispersion maximale potentielle.</Abstract><ows:Keywords><ows:Keyword>nature</ows:Keyword><ows:Keyword>environnement</ows:Keyword><ows:Keyword>trame verte</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::2154</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>2.51328125 48.850756836</ows:LowerCorner><ows:UpperCorner>2.567636719 48.881254883</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:BDCARTO_V5=\"http://BDCARTO_V5\"><Name>BDCARTO_V5:construction_lineaire</Name><Title>construction_lineaire</Title><Abstract>BD CARTO® V5</Abstract><ows:Keywords><ows:Keyword>BDCARTO</ows:Keyword></ows:Keywords><DefaultCRS>urn:ogc:def:crs:EPSG::4326</DefaultCRS><ows:WGS84BoundingBox><ows:LowerCorner>-63.15371169 -21.38982666</ows:LowerCorner><ows:UpperCorner>55.83677582 51.31504801</ows:UpperCorner></ows:WGS84BoundingBox></FeatureType><FeatureType xmlns:BDCARTO_V5=\"http://BDCARTO_V5\"><Name>BDCARTO_V5:construction_ponctuelle</Name><Title>construction_ponctuelle</Title><Abstract>BD CARTO® V5</Abstract><ows:Keywords><ows:Keyword>BDCARTO</ows:Keywo